const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            slern.io
        </div>

        <style jsx>{`
        .outerdiv {
            background-color: #B0D3F3;
            width: 100%;
            height: 80px;
            display: block;
            font-family: Arial;      
        }
        .titlelogo {
            color: #2181D5;
        }

        `}</style>
    </div>
);

export default Index;
